  false,\n\t\"url\": null,\n\t\"notes\": \"This report describes the results of the
  2002 marsh and water level management actions and summarizes the planned strategies
  for calendar year 2003 at Prime Hook National Wildlife Refuge. The most effective
  application of moist-soil management involves interplay of several impounded areas,
  each with the capability of independent operation. Strategies for integrating habitat
  and wildlife management on Prime Hook's mosaic of freshwater impoundments, which
  are nestled between salt marsh habitats, are used to attract and feed waterfowl,
  shorebirds, and other wetland dependent birds very successfully.\",\n\t\"owner_org\":
